import React from 'react';
 import { Caixa, Texto } from '../../styles/styles';
 import Fundo from '../../images/fundo.jpg'

export default props =>{
    return(
        <Caixa fonte={20} wallpaper={Fundo}> 
        <img src={Fundo} alt=""/>
            <h1 fonte={100}>Sorteador</h1>
            <h2 fonte={80}>OUTRO TEXTO</h2>
        </Caixa>
    );
}
